<!doctype html>
<html lang="en">
    <head>
        <meta charset="UTF-8" />
        <title>Title</title>
        <style>
            /* ðŸ“± MAX-SCREEN RESPONSIVE PORTRAIT */
            * {
                margin: 0;
                padding: 0;
                box-sizing: border-box;
            }

            .title {
                font-family: Consolas, "Courier New", monospace !important;
                font-size: 14px;
                line-height: 1.4;
                background: #aa8800;
                color: #ffffff;
            }
            body {
                background: #ffffff;
                display: flex;
                flex-direction: column;
                justify-content: center;
                align-items: center;
                min-height: 100vh;
                font-family: Arial, sans-serif;
                padding: 2vw; /* Responsive padding */
            }

            #portrait {
                /* MAX SCREEN SPACE MAGIC */
                width: 100%;
                max-width: 100vw;
                height: 85vh; /* Leaves room for controls */
                max-height: 85vh;
                border: 2px solid #aa8800;
                background: white;
                display: block;
                margin: 0 auto;
            }

            .controls {
                margin-top: 15px;
                text-align: center;
                width: 100%;
                max-width: 400px;
            }

            button {
                margin: 0 8px;
                padding: 12px 24px;
                font-size: 16px;
                cursor: pointer;
                background: #4caf50;
                color: white;
                border: none;
                border-radius: 8px;
                transition: background 0.3s;
            }

            button:hover {
                background: #45a049;
            }
            button:active {
                transform: scale(0.98);
            }

            .status {
                margin-top: 12px;
                font-size: 14px;
                color: #666;
                font-weight: bold;
            }

            /* ðŸ“± MOBILE OPTIMIZATION */
            @media (max-width: 480px) {
                body {
                    padding: 4vw;
                }
                #portrait {
                    height: 75vh;
                }
                button {
                    padding: 10px 16px;
                    font-size: 14px;
                    margin: 0 4px;
                }
            }
        </style>
    </head>

        <script>
            // ðŸ• 30-YEAR PORTRAIT AGING + HAIR GRAYING
            // Wrinkles slowly appear, hair slowly grays over 30 years, then flip daily forever

            const START_DATE = new Date("2025-10-16 00:00:00").getTime(); // start date
            const END_DATE = new Date("2055-10-16 00:00:00").getTime(); // 30 years later
            const TOTAL_DURATION = END_DATE - START_DATE; // 30 years exactly

            function getAllOldLayers() {
                // Find all wrinkle/details with "old" in name
                return Array.from(document.querySelectorAll('[id^="old"]'));
            }

            function getAllHairLayers() {
                // Find all hair with "hair" in name
                return Array.from(document.querySelectorAll('[id^="hair"]'));
            }

            function updateAging() {
                const now = Date.now(); // Current time

                // Calculate age (0=young, 1=old) with natural S-curve, or daily flip after 30
                const opacity =
                    now < END_DATE
                        ? 1 / (1 + Math.exp(-10 * ((now - START_DATE) / TOTAL_DURATION - 0.5)))
                        : Math.floor((now - END_DATE) / 86400000) % 2; //86400000 milliseconds in a day to flip every 24 hrs

                // Wrinkles slowly appear
                getAllOldLayers().forEach((layer) => (layer.style.opacity = opacity));

                // Hair slowly grays (fades to 40% over white background)
                getAllHairLayers().forEach((hair) => (hair.style.fillOpacity = 0.4 + 0.6 * (1 - opacity)));
            }

            updateAging(); // Start now
            setInterval(updateAging, 3600000); // Check hourly...3600000 milliseconds in an hour
        </script>
